import React from "react";

const Leaderboard = () => {
  // Sample static leaderboard, replace with backend fetch if needed
  const leaderboard = [
    { name: "Alice", wins: 10 },
    { name: "Bob", wins: 7 },
    { name: "Charlie", wins: 5 },
  ];

  return (
    <div>
      <h2 style={{ color: "#0077b6", marginBottom: "10px" }}>Leaderboard</h2>
      <table style={{ width: "100%", borderCollapse: "collapse" }}>
        <thead>
          <tr>
            <th style={{ borderBottom: "1px solid #0077b6", padding: "8px" }}>Player</th>
            <th style={{ borderBottom: "1px solid #0077b6", padding: "8px" }}>Wins</th>
          </tr>
        </thead>
        <tbody>
          {leaderboard.map((player, idx) => (
            <tr key={idx}>
              <td style={{ padding: "8px", textAlign: "center" }}>{player.name}</td>
              <td style={{ padding: "8px", textAlign: "center" }}>{player.wins}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Leaderboard;
